        //     // creating histogram each timestep
        //     for (int i = 0; i < n_e; i++){
        //         int bin = (int)( (electrons[i].energy - Emin)/bin_width );
        //         if (bin >=0 && bin < N)
        //         histo_maxwell[bin]++;
